let oldFiber = returnFiber.alternate?.child;
// \u4E0B\u4E00\u4E2AoldFiber | \u6682\u65F6\u7F13\u5B58\u4E0B\u4E00\u4E2AoldFiber
let nextOldFiber = null;
// \u7528\u4E8E\u5224\u65AD\u662FreturnFiber\u521D\u6B21\u6E32\u67D3\u8FD8\u662F\u66F4\u65B0
let shouldTrackSideEffects = !!returnFiber.alternate;
let previousNewFiber = null;
let newIndex = 0;
// \u4E0A\u4E00\u6B21dom\u8282\u70B9\u63D2\u5165\u7684\u6700\u8FDC\u4F4D\u7F6E
// old 0 1 2 3 4
// new 2 1 3 4
let lastPlacedIndex = 0;

// *1. \u4ECE\u5DE6\u8FB9\u5F80\u53F3\u904D\u5386\uFF0C\u6BD4\u8F83\u65B0\u8001\u8282\u70B9\uFF0C\u5982\u679C\u8282\u70B9\u53EF\u4EE5\u590D\u7528\uFF0C\u7EE7\u7EED\u5F80\u53F3\uFF0C\u5426\u5219\u5C31\u505C\u6B62
for (; oldFiber && newIndex < newChildren.length; newIndex++) {
  const newChild = newChildren[newIndex];
  if (newChild == null) {
    continue;
  }

  if (oldFiber.index > newIndex) {
    nextOldFiber = oldFiber;
    oldFiber = null;
  } else {
    nextOldFiber = oldFiber.sibling;
  }

  const same = sameNode(newChild, oldFiber);
  if (!same) {
    if (oldFiber == null) {
      oldFiber = nextOldFiber;
    }
    break;
  }
  const newFiber = createFiber(newChild, returnFiber);

  Object.assign(newFiber, {
    stateNode: oldFiber.stateNode,
    alternate: oldFiber,
    flags: Update,
  });

  // \u8282\u70B9\u66F4\u65B0
  lastPlacedIndex = placeChild(
    newFiber,
    lastPlacedIndex,
    newIndex,
    shouldTrackSideEffects,
  );

  if (previousNewFiber == null) {
    returnFiber.child = newFiber;
  } else {
    previousNewFiber.sibling = newFiber;
  }

  previousNewFiber = newFiber;
  oldFiber = nextOldFiber;
}

// *2. \u65B0\u8282\u70B9\u6CA1\u4E86\uFF0C\u8001\u8282\u70B9\u8FD8\u6709
// 0 1 2
// 0
if (newIndex === newChildren.length) {
  deleteRemainingChildren(returnFiber, oldFiber);
  return;
}

// *3. \u521D\u6B21\u6E32\u67D3
// 1\uFF09\u521D\u6B21\u6E32\u67D3
// 2\uFF09\u8001\u8282\u70B9\u6CA1\u4E86\uFF0C\u65B0\u8282\u70B9\u8FD8\u6709
if (!oldFiber) {
  for (; newIndex < newChildren.length; newIndex++) {
    const newChild = newChildren[newIndex];
    if (newChild == null) {
      continue;
    }
    const newFiber = createFiber(newChild, returnFiber);

    lastPlacedIndex = placeChild(
      newFiber,
      lastPlacedIndex,
      newIndex,
      shouldTrackSideEffects,
    );

    if (previousNewFiber === null) {
      // head node
      returnFiber.child = newFiber;
    } else {
      previousNewFiber.sibling = newFiber;
    }

    previousNewFiber = newFiber;
  }
}

// *4 \u65B0\u8001\u8282\u70B9\u90FD\u8FD8\u6709
// \u5C0F\u800C\u4E71
// old 0 1 [2 3 4]
// new 0 1 [3 4]
// !4.1 \u628A\u5269\u4E0B\u7684old\u5355\u94FE\u8868\u6784\u5EFA\u54C8\u5E0C\u8868
const existingChildren = mapRemainingChildren(oldFiber);

// !4.2 \u904D\u5386\u65B0\u8282\u70B9\uFF0C\u901A\u8FC7\u65B0\u8282\u70B9\u7684key\u53BB\u54C8\u5E0C\u8868\u4E2D\u67E5\u627E\u8282\u70B9\uFF0C\u627E\u5230\u5C31\u590D\u7528\u8282\u70B9\uFF0C\u5E76\u4E14\u5220\u9664\u54C8\u5E0C\u8868\u4E2D\u5BF9\u5E94\u7684\u8282\u70B9
for (; newIndex < newChildren.length; newIndex++) {
  const newChild = newChildren[newIndex];
  if (newChild == null) {
    continue;
  }
  const newFiber = createFiber(newChild, returnFiber);

  // oldFiber
  const matchedFiber = existingChildren.get(newFiber.key || newFiber.index);
  if (matchedFiber) {
    // \u8282\u70B9\u590D\u7528
    Object.assign(newFiber, {
      stateNode: matchedFiber.stateNode,
      alternate: matchedFiber,
      flags: Update,
    });

    existingChildren.delete(newFiber.key || newFiber.index);
  }

  lastPlacedIndex = placeChild(
    newFiber,
    lastPlacedIndex,
    newIndex,
    shouldTrackSideEffects,
  );

  if (previousNewFiber == null) {
    returnFiber.child = newFiber;
  } else {
    previousNewFiber.sibling = newFiber;
  }
  previousNewFiber = newFiber;
}

// *5 old\u7684\u54C8\u5E0C\u8868\u4E2D\u8FD8\u6709\u503C\uFF0C\u904D\u5386\u54C8\u5E0C\u8868\u5220\u9664\u6240\u6709old
if (shouldTrackSideEffects) {
  existingChildren.forEach((child) => deleteChild(returnFiber, child));
}
`,paraId:145,tocIndex:25},{value:"\u5176\u4E2D\u5DE5\u5177\u51FD\u6570\uFF1A",paraId:146,tocIndex:25},{value:`// \u521D\u6B21\u6E32\u67D3\uFF0C\u53EA\u662F\u8BB0\u5F55\u4E0B\u6807
// \u66F4\u65B0\uFF0C\u68C0\u67E5\u8282\u70B9\u662F\u5426\u79FB\u52A8
function placeChild(
  newFiber,
  lastPlacedIndex,
  newIndex,
  shouldTrackSideEffects,
) {
  newFiber.index = newIndex;
  if (!shouldTrackSideEffects) {
    // \u7236\u8282\u70B9\u521D\u6B21\u6E32\u67D3
    return lastPlacedIndex;
  }
  // \u7236\u8282\u70B9\u66F4\u65B0
  // \u5B50\u8282\u70B9\u662F\u521D\u6B21\u6E32\u67D3\u8FD8\u662F\u66F4\u65B0\u5462
  const current = newFiber.alternate;
  if (current) {
    const oldIndex = current.index;
    // \u5B50\u8282\u70B9\u662F\u66F4\u65B0
    // lastPlacedIndex \u8BB0\u5F55\u4E86\u4E0A\u6B21dom\u8282\u70B9\u7684\u76F8\u5BF9\u66F4\u65B0\u8282\u70B9\u7684\u6700\u8FDC\u4F4D\u7F6E
    // old 0 1 2 3 4
    // new 2 1 3 4
    // 2 1(6) 3 4
    if (oldIndex < lastPlacedIndex) {
      // move
      newFiber.flags |= Placement;
      return lastPlacedIndex;
    } else {
      return oldIndex;
    }
  } else {
    // \u5B50\u8282\u70B9\u662F\u521D\u6B21\u6E32\u67D3
    newFiber.flags |= Placement;
    return lastPlacedIndex;
  }
}

// hash\u8868
function mapRemainingChildren(currentFirstChild) {
  const existingChildren = new Map();

  let existingChild = currentFirstChild;
  while (existingChild) {
    // key: value
    // key||index: fiber
    existingChildren.set(
      existingChild.key || existingChild.index,
      existingChild,
    );
    existingChild = existingChild.sibling;
  }

  return existingChildren;
}
